import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const image1="././images/user-2.png";


// internal css:
const heading={
  color:"red",
  textTransform:"capitalize",
  background:"yellow",
  fontStyle:"bold"
};

ReactDOM.render(

  <>
  <h1 style={heading}>
  hello world</h1>
  <img src={image1} alt="title"/>

  <img src="././images/user-1.png" alt="image" className="image"/>
  </>,
  document.getElementById('root')
);
